(182, 'theme_mods_belise-lite', 'a:12:{s:18:\"custom_css_post_id\";i:-1;s:18:\"nav_menu_locations\";a:3:{s:7:\"primary\";i:2;s:12:\"social-icons\";i:3;s:10:\"categories\";i:0;}s:11:\"custom_logo\";s:0:\"\";s:23:\"belise_front_page_title\";s:26:\"<p>Finest cafe in pune</p>\";s:29:\"belise_front_page_button_text\";s:31:\"10% off on orders above Rs.1000\";s:23:\"belise_front_page_image\";s:62:\"http://localhost/wordpress/wp-content/uploads/2018/10/cafe.jpg\";s:18:\"belise_page_editor\";s:544:\"<p>We strive to provide the best experience to our guests. Our coffees are sourced from thousands of small coffee planters, who made us who we are today and we\'re glad to be a part of their lives. We opened our first cafe in 2018 at Paud Road in Pune – the youth and the young at heart immediately took to the cafe, and it continues to be one of the most happening places in the city.Cafeteria to the youth is a “hangout” spot where they meet people, make conversations, and have a whole lot of fun over steaming cups of great coffee.</p>\";s:20:\"belise_contact_phone\";s:0:\"\";s:20:\"belise_contact_email\";s:22:\" service@cafeindia.com\";s:32:\"belise_front_page_schedule_title\";s:0:\"\";s:34:\"belise_front_page_schedule_content\";s:0:\"\";s:31:\"belise_menus_section_categories\";a:1:{i:0;s:4:\"none\";}}', 'yes'),
