(27, 1, '2018-10-10 06:47:36', '2018-10-10 06:47:36', '<p>We strive to provide the best experience to our guests. Our coffees are sourced from thousands of small coffee planters, who made us who we are today and we\'re glad to be a part of their lives. We opened our first cafe in 2018 at Paud Road in Pune – the youth and the young at heart immediately took to the cafe, and it continues to be one of the most happening places in the city.Cafeteria to the youth is a “hangout” spot where they meet people, make conversations, and have a whole lot of fun over steaming cups of great coffee.</p>', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2018-10-10 07:24:22', '2018-10-10 07:24:22', '', 0, 'http://localhost/wordpress/?page_id=27', 0, 'page', '', 0),
(28, 1, '2018-10-10 06:47:37', '2018-10-10 06:47:37', '<table class=\"values-table\">\r\n<tbody>\r\n<tr>\r\n<th class=\"about-values-title\" style=\"text-align: center;\" colspan=\"2\">Our Core Values</th>\r\n</tr>\r\n<tr>\r\n<td><i class=\"fa fa-check-square-o\"></i>\r\n<strong>High Quality</strong>\r\n<p style=\"text-align: center;\">Our ingredients are delicately sourced with both time and care by using the highest standards and regulations possible.</p>\r\n</td>\r\n<td><i class=\"fa fa-leaf\"></i>\r\n<strong>Responsibility</strong>\r\n<p style=\"text-align: center;\">It is our job as humans to protect this wonderful planet we live on. We practice all acts of sustainability possible.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\"><i class=\"fa fa-cogs\"></i>\r\n<strong>Community</strong>\r\n\r\nWe value the connections we’ve made within this wonderful community and want to continue to grow + nourish them.</td>\r\n<td><i class=\"fa fa-lightbulb-o\"></i>\r\n<strong>Innovation</strong>\r\n<p style=\"text-align: center;\">Creativity is in our blood. It’s why Savor exists in the first place. We are constantly finding new ways to innovate.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"testimonials-container\">\r\n<div class=\"container\"></div>\r\n</div>', 'About', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2018-10-10 07:29:53', '2018-10-10 07:29:53', '', 0, 'http://localhost/wordpress/?page_id=28', 0, 'page', '', 0),
(29, 1, '2018-10-10 06:47:37', '2018-10-10 06:47:37', '<div>\r\n<div class=\"card \">\r\n<div class=\"text-center header\">Our Office</div>\r\n<div class=\"card-block text-center\">\r\n<h4>Address</h4>\r\n<div>2217 Kothrud\r\nPune MH\r\n#(91) 021457532\r\nservice@cafeindia.com</div>\r\n\r\n<hr />\r\n <p style=\"text-align: center;color: #999;padding: 0 20px;font-family: \'gotham-book\';font-size:18px;\"><strong style=\"color:#333;\">Alternatively, you can reach out to us at:</strong> <br/><a href=\"mailto:customercare@cafe.com\" style=\"color:#dc4348;font-family: \'gotham-medium\';\" >customercare@cafecoffeeday.com</a> <br />1800 102 5093 (9 AM to 11 PM |  Monday - Sunday)</p>\r\n</div>\r\n</div>\r\n</div>', 'Contact', '', 'publish', 'closed', 'closed', '', 'contact', '', '', '2018-10-12 07:59:48', '2018-10-12 07:59:48', '', 0, 'http://localhost/wordpress/?page_id=29', 0, 'page', '', 0),
