(35, 1, '2018-10-10 06:47:36', '2018-10-10 06:47:36', 'Welcome to your site! This is your homepage, which is what most visitors will see when they come to your site for the first time.', 'Home', '', 'inherit', 'closed', 'closed', '', '27-revision-v1', '', '', '2018-10-10 06:47:36', '2018-10-10 06:47:36', '', 27, 'http://localhost/wordpress/2018/10/10/27-revision-v1/', 0, 'revision', '', 0),
(36, 1, '2018-10-10 06:47:37', '2018-10-10 06:47:37', '<table class=\"values-table\"><tbody><tr><th class=\"about-values-title\" style=\"text-align: center\" colspan=\"2\">Our Core Values</th></tr><tr><td><i class=\"fa fa-check-square-o\"></i><br /><strong>High Quality</strong><p style=\"text-align: center\">Our ingredients are delicately sourced with both time and care by using the highest standards and regulations possible.</p></td><td><i class=\"fa fa-leaf\"></i><br /><strong>Responsibility</strong><p style=\"text-align: center\">It is our job as humans to protect this wonderful planet we live on. We practice all acts of sustainability possible.</p></td></tr><tr><td style=\"text-align: center\"><i class=\"fa fa-cogs\"></i><br /><strong>Community</strong><p>We value the connections we’ve made within this wonderful community and want to continue to grow + nourish them.<p></td><td><i class=\"fa fa-lightbulb-o\"></i><br /><strong>Innovation</strong><p style=\"text-align: center\">Creativity is in our blood. It’s why Savor exists in the first place. We are constantly finding new ways to innovate.</p></td></tr></tbody></table></div>[portfolio columns=\"4\" showposts=\"8\"]<div class=\"testimonials-container\"><div class=\"container\">[testimonials columns=\"3\"]</div>', 'About', '', 'inherit', 'closed', 'closed', '', '28-revision-v1', '', '', '2018-10-10 06:47:37', '2018-10-10 06:47:37', '', 28, 'http://localhost/wordpress/2018/10/10/28-revision-v1/', 0, 'revision', '', 0),
