(96, 1, '2018-10-12 07:15:50', '2018-10-12 07:15:50', 'We strive to provide the best experience to our guests. Our coffees are sourced from thousands of small coffee planters, who made us who we are today and we\'re glad to be a part of their lives. We opened our first cafe in 2018 at Paud Road in Pune – the youth and the young at heart immediately took to the cafe, and it continues to be one of the most happening places in the city.Cafeteria to the youth is a “hangout” spot where they meet people, make conversations, and have a whole lot of fun over steaming cups of great coffee.\n\n', 'Home', '', 'inherit', 'closed', 'closed', '', '27-autosave-v1', '', '', '2018-10-12 07:15:50', '2018-10-12 07:15:50', '', 27, 'http://localhost/wordpress/2018/10/12/27-autosave-v1/', 0, 'revision', '', 0),
